import { styled } from './stitches.config';

const StyledReading = styled('li', {})

const Link = styled('a', {
    fontWeight: '700',
    color: '$foreground',
    textDecoration: 'none',
    lineHeight: '25px',
    transition: 'all 0.1s ease',
    outline: 'none',
})

interface ReadingsProps {
    link: string
    text: string
}

const Reading = ({link, text}: ReadingsProps) => {
    return(
        <StyledReading>
            <Link href={link}>{text}</Link>
        </StyledReading>
    )
}

export default Reading;
